import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import feiyanChinaData from './china_feiyan_data.json'



feiyanChinaData.data.forEach((item, key)=>{
    console.log(item);

    let feiyanChinaitem =  {
      name: "",
      confirm: 0,
      cure: 0,
      dead: 0,
      exist: 0,
    }  

    feiyanChinaitem.name = item.name;

    item.trend.list.forEach((item_trend, key_trend)=>{
      let curr = item.trend.data.length;
      if(item_trend.name="确诊") feiyanChinaitem.confirm = item_trend.confirm[curr-1];
      if(item_trend.name="治愈") feiyanChinaitem.confirm = item_trend.exist[curr-1];
      if(item_trend.name="死亡") feiyanChinaitem.confirm = item_trend.dead[curr-1];
      if(item_trend.name="新增确诊") feiyanChinaitem.confirm = item_trend.cure[curr-1];
    });

    console.log(feiyanChinaitem);

});
